import React from 'react'
import {
  Container,
  Fieldset,
  Input,
  Select,
  Button,
  Base,
  Option,
  InputRadio,
  Label,
} from './styles/form'

export default function Form({ children, ...restProps }: any) {
  return <Container {...restProps}>{children}</Container>
}

Form.Base = function formBase({ children, ...restProps }: any) {
  return <Base {...restProps}>{children}</Base>
}

Form.Fieldset = function formFieldset({ children, ...restProps }: any) {
  return <Fieldset {...restProps}>{children}</Fieldset>
}

Form.Select = function formSelect({ children, ...restProps }: any) {
  return <Select {...restProps}>{children}</Select>
}

Form.Option = function formOption({ children, ...restProps }: any) {
  return <Option {...restProps}>{children}</Option>
}
Form.InputRadio = function formInputRadio({ children, ...restProps }: any) {
  return <InputRadio {...restProps}>{children}</InputRadio>
}
Form.Label = function formLabel({ children, ...restProps }: any) {
  return <Label {...restProps}>{children}</Label>
}

Form.ButtonSelect = function formButtonSelect({ children, ...restProps }: any) {
  return <ButtonSelect {...restProps}>{children}</ButtonSelect>
}
Form.Image = function formImage({ children, ...restProps }: any) {
  return <Image {...restProps}>{children}</Image>
}

Form.BaseOptions = function formBaseOptions({ children, ...restProps }: any) {
  return <BaseOptions {...restProps}>{children}</BaseOptions>
}

Form.Input = function formInput({ children, ...restProps }: any) {
  return <Input {...restProps}>{children}</Input>
}
Form.Button = function formButton({ children, ...restProps }: any) {
  return <Button {...restProps}>{children}</Button>
}
